import React, {useState, useEffect} from 'react';
import styled from 'styled-components';


const Styles = styled.div``;

function SearchResult(props){
    return(
        <React.Fragment>
            <Styles>
            {props.resultat.map( (res) => 
               <div>
                    <p>{res.pneuId}</p>
                    <p>{res.collection}</p>
                    <p>{res.charge}</p>
                    <p>{res.designation_pneu}</p>
                    <p>{res.marque}</p>
                    <p>{res.image_url}</p>
                    <img
                        src={`https://www.monsterstudio.org${res.image_url}`}
                        style={{margin:'0 0 28% 0', padding:'0'}}
                    />
              </div>
            )}            
        </Styles>
        </React.Fragment>
    )
}

export default SearchResult;

